webpackJsonp([0xe5f82b5e0c9d],{7862:function(e,t){e.exports={data:{post:{html:"<p>Tonight's <a href=\"http://www.sabinechristiansen.de/\">Sabine Christiansen</a> talk show on ARD is on the topic of obesity, and among the guests is <a href=\"http://www.mcdonalds.de/presse/basis/vorstand/goebel.html\">Wolfgang Goebel</a>, Vice President for Operations for McDonald's Deutschland (and, for a few more days, MamaMaus' boss).</p>\n<p>We're no big fans of Christiansen, but her show is the best known talk show on German television. We usually don't stay up until 21:45 on Sunday nights, but tonight we might make an exception. I do suspect, though, that the producers deliberately chose a soft topic for the holiday weekend.</p>",fields:{title:"McDonald's on Sabine Christiansen Tonight",date:"29 Apr 2007",url:"https://papascott.de/2007-04-29-mcdonalds-on-sabine-christiansen-tonight/"}}},pathContext:{slug:"/2007-04-29-mcdonalds-on-sabine-christiansen-tonight/",prev:{fields:{title:"Back to Back",date:"29 Apr 2007",slug:"/2007-04-29-back-to-back/"}},next:{fields:{title:"Lead the World",date:"30 Apr 2007",slug:"/2007-04-30-lead-the-world/"}}}}}});
